"<p>This blog is powered by b2evolution.</p>\n\n<p>You are currently looking at an info page about %s.</p>\n\n<p>Info pages are very much like regular posts, except that they do not appear in the regular flow of posts. They appear as info pages in the sidebar instead.</p>\n\n<p>If needed, an evoskin can format info pages differently from regular posts.</p>" => "<p>Este blog es \"powered\" por b2evolution.</p>\n\n<p>En este momento estás viendo una página informativa sobre %s.</p>\n\n<p>Páginas informativas son muy parecidas a publicaciones normales, excepto que no aparezcan en el flujo regular de publicaciones, sino que se muestran como páginas informativas en una barra lateral.</p>\n\n<p>De ser necesario, un skin puede formatear estas páginas de manera diferente a los publicaciones normales.</p>",
'About Blog B' => 'Acerca de Blog B',
