'About Blog A' => 'Acerca de Blog A',
'Blog A' => 'Blog A',
"<p>This blog platform is powered by b2evolution.</p>\n\n<p>You are currently looking at an info page about this system. It is cross-posted among the demo blogs. Thus, this page will be linked on each of these blogs.</p>\n\n<p>Info pages are very much like regular posts, except that they do not appear in the regular flow of posts. They appear as info pages in the sidebar instead.</p>\n\n<p>If needed, an evoskin can format info pages differently from regular posts.</p>" => "<p>Esta plataforma de blog usa el motor b2evolution.</p>\n\n<p>En este momento está viendo una página informativa sobre este sistema. Ha sido publicada cruzada en los blogs de ejemplo. Por lo tanto, está vinculada en cada uno de ellos.</p>\n\n<p>Las páginas informativas son muy parecidas a publicaciones normales, excepto que no aparecen en el flujo regular de publicaciones, sino que se muestran como páginas informativas en una barra lateral.</p>\n\n<p>De ser necesario, un tema puede formatear estas páginas de manera diferente a los publicaciones normales.</p>",
'Main Intro post' => 'Artículo de Introducción Principal',
'This is the main intro post. It appears on the homepage only.' => 'Este es el artículo de introducción principal. Aparece únicamente en la página de inicio.',
'This uses post type "Intro-Cat" and is attached to the desired Category(ies).' => 'Esto utiliza el tipo de artículo "Intro-Cat" y se adjunta a la(s) Categoría(s) deseada(s).',
'b2evolution tips category &ndash; Sub Intro post' => 'categoría de notas b2evolution &ndash; artículo Sub Intro',
'This uses post type "Intro-Tag" and is tagged with the desired Tag(s).' => 'Esto usa el tipo de artículo "Intro-Tag" y es clasificado con la(s) etiqueta(s) deseada(s)',
'Widgets tag &ndash; Sub Intro post' => 'Etiqueta de complemento &ndash; artículo Sub Intro',
"<p>This is a demo of a featured post.</p>\n\n<p>It will be featured whenever we have no specific \"Intro\" post to display for the current request. To see it in action, try displaying the \"Announcements\" category.</p>\n\n<p>Also note that when the post is featured, it does not appear in the regular post flow.</p>" => "<p>Esto es un ejemplo de un artículo destacado.</p>\n\n<p>Será destacado mientras no haya un artículo \"Intro\" para mostrar en el contenido solicitado actual. Para verlo en funcionamiento, intenta ver la categoría \"Anuncios\".</p>\n\n<p>Toma nota de que cuando un artículo es destacado, no seguirá el flujo de artículos normales.</p>",
"<p>b2evolution comes with an <code>.htaccess</code> file destined to optimize the way b2evolution is handled by your webseerver (if you are using Apache). In some circumstances, that file may not be automatically activated at setup. Please se the man page about <a %s>Tricky Stuff</a> for more information.</p>\n\n<p>For further optimization, please review the manual page about <a %s>Performance optimization</a>. Depending on your current configuration and on what your <a %s>web hosting</a> company allows you to do, you may increase the speed of b2evolution by up to a factor of 10!</p>" => "<p>b2evolution viene con un archivo <code>.htaccess</code> destinado a optimizar la forma en que b2evolution es presentado por tu servidor web (si estás usando Apache). En algunas circustancias, este archivo podría no activarse automaticamente en la configuración. Por favor mira la página de documentación sobre <a %s>Tricky Stuff</a> para más información.</p>\n\n<p>Para una optimización más precisa, por favor revisa la página del manual sobre <a %s>Optimización de rendimiento</a>. Dependiendo de tu configuración actual y de lo que tu proveedor de <a %s>alojamiento web</a> te permita hacer, ¡podrías incrementar la velocidad de tu b2evolution por 10!</p>",
'Apache optimization...' => 'Optimización Apache...',
"<p>By default, blogs are displayed using an evoskin. (More on skins in another post.)</p>\n\n<p>This means, blogs are accessed through '<code>index.php</code>', which loads default parameters from the database and then passes on the display job to a skin.</p>\n\n<p>Alternatively, if you don't want to use the default DB parameters and want to, say, force a skin, a category or a specific linkblog, you can create a stub file like the provided '<code>a_stub.php</code>' and call your blog through this stub instead of index.php .</p>\n\n<p>Finally, if you need to do some very specific customizations to your blog, you may use plain templates instead of skins. In this case, call your blog through a full template, like the provided '<code>a_noskin.php</code>'.</p>\n\n<p>If you want to integrate a b2evolution blog into a complex website, you'll probably want to do it by copy/pasting code from <code>a_noskin.php</code> into a page of your website.</p>\n\n<p>You will find more information in the stub/template files themselves. Open them in a text editor and read the comments in there.</p>\n\n<p>Either way, make sure you go to the blogs admin and set the correct access method/URL for your blog. Otherwise, the permalinks will not function properly.</p>" => "<p>Por defecto, todas los blogs se muestran usando un tema. (Más sobre temas en otro artículo.)</p>\n\n<p>Esto significa que se accede a los blogs vía '<code>index.php</code>', lo que carga los parámetros predeterminados desde la base de datos para luego pasar el resto del trabajo de mostrarlos a un tema.</p>\n\n<p>Alternativamente, si no quieres usar los parámetros predeterminados de la base de datos y quieres, para llamarlo, \"forzar\" un skin, una categoría o un blog de Vínculos específico, puedes crear un archivo stub como el que está en '<code>a_stub.php</code>' y llamar a tu blog a través de este stub en vez de vía index.php .</p>\n\n<p>Finalmente, si quieres personalizar tu blog de una forma específica, puedes usar plantillas comunes en vez de skins. En este caso, llamas a tu blog vía una plantilla completa, como la que está en '<code>a_noskin.php</code>'.</p>\n\n<p>Si quieres integrar un blog b2evolution en un sitio Web más complejo, lo más probable es que quieres hacerlo copiando y pegando el código desde <code>a_noskin.php</code> a una página de tu sitio.</p>\n\n<p>Encontrarás más información en los mismos archivos stub/plantilla. Ábralos en un editor de textos y lea los comentarios incluidos allí.</p>\n\n<p>De cualquier modo, asegúrate de ir a la admin del blog y configurar el método de acceso/URL correcto. De lo contrario, los permalink no funcionarán correctamente.</p>",
'Skins, Stubs, Templates &amp; website integration...' => 'Temas, archivos estáticos, plantillas &amp; integración en el sitio web...',
"<p>b2evolution blogs are installed with a default selection of Widgets. For example, the sidebar of this blog includes widgets like a calendar, a search field, a list of categories, a list of XML feeds, etc.</p>\n\n<p>You can add, remove and reorder widgets from the Blog Settings tab in the admin interface.</p>\n\n<p>Note: in order to be displayed, widgets are placed in containers. Each container appears in a specific place in an evoskin. If you change your blog skin, the new skin may not use the same containers as the previous one. Make sure you place your widgets in containers that exist in the specific skin you are using.</p>" => "<p>Los blogs de b2evolution se instalan con una selección predeterminada de complementos. Por ejemplo, la barra lateral de este blog incluye complementos tales como calendario, búsquedas, listados de categorías, lista de suscripciones XML, etc.</p>\n\n<p>Puedes añadir, quitar o reordenar los complementos desde la pestaña Configuración del Blog en la interfaz de administración.</p>\n\n<p>Nota: para poder mostrarse, los complementos están situados en contenedores. Cada contenedor aparece en un lugar específico de un tema visual. Si cambias el tema visual de tu blog, el tema nuevo posiblemente no use los mismos contenedores que el anterior. Asegúrate de colocar tus complementos en los contenedores existentes en el tema específico que estás usando.</p>",
'About widgets...' => 'Acerca de Complementos...',
"<p>By default, b2evolution blogs are displayed using an evoskin.</p>\n\n<p>You can change the skin used by any blog by editing the blog settings in the admin interface.</p>\n\n<p>You can download additional skins from the <a href=\"http://skins.b2evolution.net/\" target=\"_blank\">skin site</a>. To install them, unzip them in the /blogs/skins directory, then go to General Settings &gt; Skins in the admin interface and click on \"Install new\".</p>\n\n<p>You can also create your own skins by duplicating, renaming and customizing any existing skin folder from the /blogs/skins directory.</p>\n\n<p>To start customizing a skin, open its \"<code>index.main.php</code>\" file in an editor and read the comments in there. Note: you can also edit skins in the \"Files\" tab of the admin interface.</p>\n\n<p>And, of course, read the <a href=\"http://manual.b2evolution.net/Skins_2.0\" target=\"_blank\">manual on skins</a>!</p>" => "<p>Por defecto, todas los blogs se muestran usando un tema.</p>\n\n<p>Puedes cambiar el tema predeterminado de cualquier blog editando su configuración en la interfaz de administración.</p>\n\n<p>Puedes descargar skins adicionales desde <a href=\"http://skins.b2evolution.net/\" target=\"_blank\">skins.b2evolution.net</a>. Para instalarlas, descomprima el archivo en el directorio <code>/blogs/skins/</code>, navega a Configuración Global &gt; Instalación de Skins en la interfaz administrativa y pulsa \"Instalar nuevo\".</p>\n\n<p>Para personalizar un skin, abra su archivo '<code>index.main.php</code>' en un editor de textos y lea los comentarios que contiene. Nota: Puedes editar skins en la pestaña \"Archivos\" de la interfaz administrativa.</p>\n\n<p>¡Y, por supuesto, lea el manual en línea <a href=\"http://manual.b2evolution.net/Skins_2.0\" target=\"_blank\"> sobre skins</a>!</p>",
'About skins...' => 'Acerca de Skins',
"<p>This post has an image attached to it. The image is automatically resized to fit the current blog skin. You can zoom in by clicking on the thumbnail.</p>\n\n<p>Check out the photoblog (accessible through the links at the top) to see a completely different skin focused more on the photos than on the blog text.</p>" => "<p>Este artículo tiene una imagen adjunta a él. La imágen se redimensionará automaticamente para ajustarse al tema actual. Puedes hacer zoom haciendo clic en la miniatura.</p>\n\n<p>Verifica el fotoblog (accesible a través de los enlaces de la parte superior) para ver un tema completamente diferente enfocado más en las imágenes que en los textos del blog.</p>",
'Image post' => 'Artículo imágen',
"<p>This is page 1 of a multipage post.</p>\n\n<p>You can see the other pages by clicking on the links below the text.</p>\n\n<!--nextpage-->\n\n<p>This is page 2.</p>\n\n<!--nextpage-->\n\n<p>This is page 3.</p>\n\n<!--nextpage-->\n\n<p>This is page 4.</p>\n\n<p>It is the last page.</p>" => "<p>Esta es la página 1 de una publicación de múltiples páginas.</p>\n\n<p>Puedes ver las otras páginas pulsando los vínculos debajo de este texto.</p>\n\n<!--nextpage-->\n\n<p>Esta es la página 2.</p>\n\n<!--nextpage-->\n\n<p>Esta es la página 3.</p>\n\n<!--nextpage-->\n\n<p>Esta es la página 4.</p>\n\n<p>Esta es la última página.</p>",
'This is a multipage post' => 'Este es una publicación multipágina',
"<p>This is an extended post with no teaser. This means that you won't see this teaser any more when you click the \"more\" link.</p>\n\n<!--more--><!--noteaser-->\n\n<p>This is the extended text. You only see it when you have clicked the \"more\" link.</p>" => "<p>Este es un artículo extendido sin separador. Esto significa que el separador desaparece cuando pulsas en el vínculo \"más\".\n\n<!---more--><!--noteaser-->\n\n<p>Este es el texto extendido. Solo lo verás una vez que pulsaste el vínculo \"más\".</p>",
'Extended post with no teaser' => 'Publicación extendido sin teaser',
"<p>This is an extended post. This means you only see this small teaser by default and you must click on the link below to see more.</p>\n\n<!--more-->\n\n<p>This is the extended text. You only see it when you have clicked the \"more\" link.</p>" => "<p>Este es un artículo extendido. Esto significa que solo puedes ver este separador pequeño por defecto, y que debes pulsar el vínculo abajo para ver más.</p>\n\n<!--more-->\n\n<p>Este es el texto extendido. Solo lo verás una vez que pulsaste el vínculo \"más\".</p>",
'Extended post' => 'Publicación extendida',
"<p>Four blogs have been created with sample contents:</p>\n\n<ul>\n\t<li><strong>Blog A</strong>: You are currently looking at it. It contains a few sample posts, using simple features of b2evolution.</li>\n\t<li><strong>Blog B</strong>: You can access it from a link at the top of the page. It contains information about more advanced features.</li>\n\t<li><strong>Linkblog</strong>: By default, the linkblog is included as a \"Blogroll\" in the sidebar of both Blog A &amp; Blog B.</li>\n\t<li><strong>Photoblog</strong>: This blog is an example of how you can use b2evolution to showcase photos, with one photo per page as well as a thumbnail index.</li>\n</ul>\n\n<p>You can add new blogs, delete unwanted blogs and customize existing blogs (title, sidebar, blog skin, widgets, etc.) from the Blog Settings tab in the admin interface.</p>" => "<p>Cuatro blogs han sido creados con contenido de muestra:</p>\n\n<ul>\n\t<li><strong>Blog A</strong>: Es lo que estás viendo actualmente. Contiene unas publicaciones de muestra, que usan los atributos básicos de b2evolution.</li>\n\t<li><strong>Blog B</strong>: Puedes acceder a él desde el vínculo el el parte superior de la página. Contiene información sobre atributos más avanzados.</li>\n\t<li><strong>Blog de Vínculos</strong>: Por defecto, el blog de vínculos es incluida como un \"Listado de Blogs\" en la barra lateral tanto del Blog A como Blog B.</li>\n\t<li><strong>Fotoblog</strong>: Este blog un ejemplo de cómo usar b2evolution para mostrar fotos, con un foto por página y también un índice de miniaturas.</li>\n</ul>\n\n<p>Puedes agregar blogs nuevos, eliminar blogs no deseados y personalizar blogs existentes (título, menú lateral, tema, complementos, etc.) desde la pestaña Configuración de Blog en la interfaz del administrador.</p>",
'Welcome to b2evolution!' => '¡Bienvenido a b2evolution!',
'Hi, this is a comment.<br />To delete a comment, just log in, and view the posts\' comments, there you will have the option to edit or delete them.' => 'Hola, este es un cometario.<br />Para eliminar un comentario, es necesario que ingresas, para poder revisar los comentarios sobre la publicación; allí también existe una opción para editar o eliminarlas.',
