'Copy the contents from the box below.' => 'Copia el contenido en la caja abajo.',
'Paste them into your local text editor. <strong>ATTENTION: make sure there is ABSOLUTELY NO WHITESPACE after the final <code>?&gt;</code> in the file.</strong> Any space, tab, newline or blank line at the end of the conf file may prevent cookies from being set when you try to log in later.' => 'Pégalo en tu editor de textos local. <strong>ATENCIÓN: asegúrate de que no hay absolutamente NINGÚN ESPACIO EN BLANCO después de <code>?&gt;</code> al final del archivo. </strong> Cualquier espacio, tabulación, salto de línea o línea en blanco al final del archivo de configuración puede generar errores en la colocación de cookies cuando tratas de ingresar posteriormente.',
'Save the file locally under the name <code>_basic_config.php</code>' => 'Guardar el archivo localmente bajo el nombre <code>_basic_config.php</code>',
