'This is the minimum info we need to set up b2evolution on this server:' => 'Esta es la información mínima que necesitamos para configurar b2evolution en este servidor:',
'Database you want to install into' => 'Base de datos en la que quieres instalarlo',
'b2evolution stores blog posts, comments, user permissions, etc. in a MySQL database. You must create this database prior to installing b2evolution and provide the access parameters to this database below. If you are not familiar with this, you can ask your hosting provider to create the database for you.' => 'b2evolution almacena artículos de blog, comentarios, permisos de usuario, etc. en una base de datos MySQL. Debes crear esta base de datos previamente a instalar b2evolution e introducir los datos de acceso a dicha base de datos a continuación. Si no estás familiarizado con esto, puedes preguntar a tu proveedor de alojamiento web para que cree la base de datos por ti.',
'Typically looks like "localhost" or "sql-6" or "sql-8.yourhost.net"...' => 'Comunmente suele ser "localhost" o "sql-6" o "sql-8.tuservidor.net"...',
'MySQL Database' => 'Base de datos MySQL',
'Name of the MySQL database you have created on the server' => 'Nombre de la base de datos MySQL que has creado en el servidor',
'Used by b2evolution to access the MySQL database' => 'Usado por b2evolution para acceder a la base de datos MySQL',
'Additional settings' => 'Configuraciones adicionales',
'This is where b2evo and your blogs reside by default. CHECK THIS CAREFULLY or not much will work. If you want to test b2evolution on your local machine, in order for login cookies to work, you MUST use http://<strong>localhost</strong>/path... Do NOT use your machine\'s name!' => 'Aquí es donde b2evo y tus blogs residen por defecto. REVÍSALO CUIDADOSAMENTE o podría no funcionar. Si quieres probar b2evolution en tu equipo local, para que funcionen las cookies de logueo, DEBES usar http://<strong>localhost</strong>/ruta... ¡NO deberías utilizar el nombre de tu equipo!',
'This is used to create your admin account. You will receive notifications for comments on your blog, etc.' => 'Esto es usado para crear tu cuenta de administrador. Recibirás notificaciones por comentarios en tu blog, etc.',
'Your email' => 'Tu email',
'Update config file' => 'Actualizar archivo de configuración',
'How would you like your b2evolution installed?' => '¿Cómo quieres que se instale b2evolution?',
'The installation can be done in different ways. Choose one:' => 'Esta instalación se realizar de distintas maneras. Elija una:',
'<strong>New Install</strong>: Install b2evolution database tables.' => '<strong>Nueva Instalación</strong>: Instalar tablas de base de datos de b2evolution.',
'Also install sample blogs &amp; sample contents. The sample posts explain several features of b2evolution. This is highly recommended for new users.' => 'Instalar también blogs y contenido de muestra. Estas publicaciones de muestra explican varias atributos de b2evolution. Altamente recomendado para usuarios nuevos.',
'<strong>Upgrade from a previous version of b2evolution</strong>: Upgrade your b2evolution database tables in order to make them compatible with the current version. <strong>WARNING:</strong> If you have modified your database, this operation may fail. Make sure you have a backup.' => '<strong>Actualizar desde una versión anterior de b2evolution</strong>: Actualizar tu tablas en la base de datos b2evolution para compatibilizarlas con la versión actual. <strong>ADVERTENCIA:</strong> Si modificaste tu base de datos, esta operación podría fallar. Asegúrate que tengas un respaldo.',
'If you have installed b2evolution tables before and wish to start anew, you must delete the b2evolution tables before you can start a new installation. <strong>WARNING: All your b2evolution tables and data will be lost!!!</strong> Any non-b2evolution tables will remain untouched though.' => 'Si instalaste tablas de b2evolution previamente y deseas comenzar de nuevo, debes eliminar las tablas de b2evolution antes de iniciar una nueva instalación. <strong>ADVERTENCIA: ¡¡¡Todas las tablas y datos de b2evolution se pierdan!!!</strong> No obstante, todas las tablas que no son b2evolution permanecerán intactas.',
'<strong>Change your base configuration</strong> (see recap below): You only want to do this in rare occasions where you may have moved your b2evolution files or database to a different location...' => '<strong>Cambar tu configuración básica</strong> (ver recapitulación abajo): Sólo querrás hacer esto en contadas ocasiones, donde moviste tus archivos de b2evolution o la base de datos a una locación diferente...',
