'Display computer code easily.  This plugin renders character entities on the fly, so you can cut-and-paste normal code directly into your posts and it will always look like normal code, even when editing the post (i.e., no preprocessing of the code is required). Include line numbers (customizable starting number).  The best part about the line numbers - visitors can cut-and-paste the code from your post, leaving the line numbers behind! Accepts BBcode tags and does not render smilies.  Colouration of PHP code, plus PHP manual links for PHP functions. Easy to install and easy to use. No hacks. Degrades nicely, if the plugin is off.  Styling completely customizable via your skins CSS file.' => 'Mostrar código computacional de manera fácil. Este plugin genera entidades de caracteres instantáneamente, para que puedes cortar y pegar código normal directamente en tus publicaciones; siempre se verá como código común, incluso cuando estás editando la publicación (e.d., no se necesita ningún pre-procesamiento). Incluye números de línea (número de inicio personalizable). Lo mejor de todo son los números de línea: los visitantes pueden cortar y pegar el código desde tu publicación, ¡dejando atrás los número de línea! Acepta etiquetas BBcode y no genera smilies. Coloración de código PHP, y vínculos a los manuales PHP para funciones. Fácil de instalar y usar. Sin hacks. Se degrada elegantemente cuando el plugin está apagado. Diseño completamente personalizable vía la CSS de tu skin.',
